  $slug: String!
) {
  site {
    siteMetadata {
      title
      author
      siteUrl
      comment {
        disqusShortName
        utterances
      }
      sponsor {
        buyMeACoffeeId
      }
    }
  }
  markdownRemark(fields: {slug: {eq: $slug}}) {
    id
    excerpt(pruneLength: 280)
    html
    frontmatter {
      title
      date(formatString: "MMMM DD, YYYY")
    }
  }
}

